import React from 'react';
import classes from './Button.module.css';

const Button=(props)=>
{
    return(
        <button classeName={classes.button} 
        type={props.type|| 'button'} 
        onClick= {props.onClick}>
            {props.children}
        </button>
    );
}
export default Button;
